cXyz daShopItem_c::getCenter() {
    f32 height;
    if(FLOWER_1 <= m_itemNo && m_itemNo <= PRESIDENT_STATUE) {
        height = 80.0f;
    }
    else {
        height = 40.0f;
    }

    cXyz ret(0.0f, height / 2.0f, 0.0f);
    return ret;
}

